import React, { useEffect } from 'react';
import Person from '../assets/Person';
import Note from '../assets/Note';

const Home: React.FC = () => {
	return (
		<div className='container-fluid'>
			<div className='row'>
				<div className='col-md-3'>
					<div className=''>
						<Person />
					</div>
				</div>
				<div className='col-md-6'>
					<h2 className='title'>Explore</h2>
					<div className='line'></div>
					<p>
						Lorem ipsum dolor sit amet consectetur adipisicing elit. Eos ab
						atque vel assumenda, quisquam cupiditate laborum adipisci voluptatum
						dignissimos hic voluptas saepe eveniet officia harum animi neque
						perferendis tempora numquam!
					</p>
				</div>
				<div className='col-md-3'>
					<div className='bounceInDown'>
						<Note />
					</div>
				</div>
			</div>
		</div>
	);
};

export default Home;
